function drawPathTestWithoutRoadSnap(p,indx) {

    if (PolyLines != null) {

        //PolyLines[indx].setPath(null);
        PolyLines[indx].setMap(null);

    } else {

        PolyLines[indx] = new google.maps.Polyline({
            strokeOpacity: 0,
            icons: [{
                icon: lineSymbol,
                offset: '0',
                repeat: '10px'
            }],
            //path: p
            //geodesic: true,
            strokeColor: Colors[indx],
            //strokeOpacity: 0
            //strokeWeight: 2        
        });
    }

    //trick to force a "redraw" of the map
    google.maps.event.trigger(map, 'resize');

    PolyLines[indx].setPath(p);
    PolyLines[indx].setOptions({ strokeColor: Colors[indx] });

    //oSnap = new cSnapToRoute();
    //oSnap.init(map, clockMarker, flightPath);

    //Open the InfoWindow on mouseover:
    //google.maps.event.addListener(PolyLines[indx], 'mouseover', flightPath_MouseOver)

    // Close the InfoWindow on mouseout:
    //google.maps.event.addListener(PolyLines[indx], 'mouseout', flightPath_MouseOut)

    PolyLines[indx].setMap(cbShowjourney.GetChecked() ? map : null);

    var setMapBoundsForJourney = ((cbShowjourney.GetChecked()) && (!cbAutoIncrement.GetChecked()) && (!cbHeatmapAutoUpdate.GetChecked()))
    
    if (setMapBoundsForJourney == true) { zoomToObject(PolyLines[indx]); }

}

function zoomToObject(obj) {

    var bounds = new google.maps.LatLngBounds();
    var points = obj.getPath().getArray();
    for (var n = 0; n < points.length ; n++) {
        bounds.extend(points[n]);
    }
    map.fitBounds(bounds);
}

function flightPath_MouseOver(e) {
    infoWindow.setPosition(e.latLng);
    infoWindow.setContent("You are at " + e.latLng);
    infoWindow.open(map);
}

function flightPath_MouseOut(e) {

    infoWindow.close();
}


