// Snap a user-created polyline to roads and draw the snapped path


function runSnapToRoad(pathArr,indx) {

    var thisPathArr = [];
    var maxCount = pathArr.length;

    if (maxCount > 100) { maxCount = 100 }

    for (var i = 0; i < maxCount; i++) {
        thisPathArr.push(pathArr[i]);
    }

    var remainderPathArr = pathArr.splice(maxCount, pathArr.length);


    $.get('https://roads.googleapis.com/v1/snapToRoads', {
        interpolate: true,
        key: apiKey,
        path: thisPathArr.join('|')
    }, function (data) {
        //alert(JSON.stringify(data));
        processSnapToRoadResponse(data, remainderPathArr,indx);
    });

    // receivedSnappedDataFromGoogle(pathValues);
}

var snappedCoordinates = [];

//var snappedCoordinatesIndex = 


//pathValues:= the remainder of the values to be "interpolated" by the google method
function processSnapToRoadResponse(data, pathValues, indx) {

    //snappedCoordinates = [];
    //placeIdArray = [];
    //snappedCoordinates array contains an array of arrays (the second being lat/long combinations which have been returned from google)
    if (snappedCoordinates[indx] == null) snappedCoordinates[indx] = [];

    for (var i = 0; i < data.snappedPoints.length; i++) {

        var latlng = new google.maps.LatLng(data.snappedPoints[i].location.latitude, data.snappedPoints[i].location.longitude);
        snappedCoordinates[indx].push(latlng);
        //placeIdArray.push(data.snappedPoints[i].placeId);
    }

    if (pathValues.length == 0) {
        receivedSnappedDataFromGoogle(snappedCoordinates[indx], indx);
        snappedCoordinates[indx] = [];
    } else {
        //rerun the google app with this method (processSnapToRoadResponse) as its callback delagate
        runSnapToRoad(pathValues, indx);
    }
}


function receivedSnappedDataFromGoogle(thisPath, indx) {

    var newArr = [];

    try {

        PolyLines[indx].getPath().j.forEach(

          function (item, index) {
              //flightPath.getPath()
              var itm = new google.maps.LatLng(item.lat(), item.lng());
              newArr.push(itm);
          }
        )
    } catch (e) { }


    thisPath.forEach(
      function (item, index) {
          //flightPath.getPath()
          var itm = new google.maps.LatLng(item.lat(), item.lng());
          newArr.push(itm);
      }
    )

    drawPathTestWithoutRoadSnap(newArr, indx);
    //flightPath.setPath(newArr);
}